`;
const ProjectAbout = styled.div `
  font-size: 36px;

`;
const ProjectAboutText = styled.div `
  font-size: 24px;

`;

function WhatToWear() {  
  return (
    <React.Fragment>
        <ProjectTitle>What To Wear</ProjectTitle>
    </React.Fragment>
    
